import React from 'react';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from "yup";

export default function New() {

  const schema = yup.object({
    brand: yup.string().required('É necessário que o campo de marca seja preenchido'),
    color: yup.string().required('É necessário que o campo de cor seja preenchido'),
    year: yup.number().required('É necessário que o campo de ano seja preenchido'),
  }).required();

  const { register, handleSubmit, formState: { errors } } = useForm({
    resolver: yupResolver(schema)
  });
  const onSubmit = async (data) => { console.log(data)};

  return (
    <main>
        <form onSubmit={handleSubmit(onSubmit)}>
        <input {...register("name", { required: true })} />
        <input {...register("brand", { required: true })} />
        <input {...register("color", { required: true })} />
        <input {...register("year", { required: true })} />
        <input {...register("plate", { required: true })} />
        <input {...register("description", { required: true })} />
        <input type="number" {...register("price", { required: true })} />
        <input type="submit" />
      </form>
    </main>
  )
}
